    matrix:
      columns:
        one:
          key:
            column_net: P1
            column_mark: 1
        two:
          spread: 1cx
          key:
            column_net: P0
            column_mark: 2
        three:
          spread: 1cx
          key:
            column_net: P14
            column_mark: 3
