              skip: false
              shift: [-0.5cx, 1cy]
              rotate: 180
        eight:
          spread:  1cx
          key:
            column_net: P5
            column_mark: 8
        nine:
          spread:  1cx
          key:
            column_net: P6
            column_mark: 9
        ten:
          spread:  1cx
          key:
            column_net: P7
            column_mark: 10
