          spread:  1cx
          key:
            column_net: P8
            column_mark: 11
        twelve:
          spread:  1cx
          key:
            column_net: P9
            column_mark: 12
      rows:
        2uspacebar:
          padding: 1cy
          row_net: P19
          skip: true
        modrow:
          padding: 1cy
          row_net: P19
        bottom:
          padding: 1cy
          row_net: P18
        home:
          padding: 1cy
          row_net: P15
        top:
          padding: 1cy
          row_net: P21
  key:
    bind: 2
    footprints:
      choc:
        type: choc
        anchor:
        nets:
          from: =colrow
          to: =column_net
        params:
          keycaps: true
      diode:
        type: diode
        anchor:
          rotate: 0
          shift: [ 0, -4.5 ]
        nets:
          from: =colrow
          to: =row_net
        params:
          via_in_pad: true
          through_hole: false
outlines:
  exports:
    raw:
      - type: keys
        side: left
        size: [1cx,1cy]
        corner: 1
    panel:
      - type: outline
        name: raw
        fillet: 0.5
    switch_cutouts:
      - type: keys
        side: left
        size: 14
        bound: false
    switch_plate:
      main:
        type: outline
        name: panel
        fillet: 0.5
      keyholes:
        type: outline
        name: switch_cutouts
        operation: subtract
pcbs:
