        anchor:
          ref: matrix_seven_top
          shift: [-0.5cx, 1]
        params:
          orientation: down
      powerswitch:
        type: slider
        anchor:
          ref: matrix_four_top
          shift: [0.5cx, 8.95]
        nets:
          from: RAW
          to: BAT
        params:
          side: B
      jstph:
